	private static final String COMMAND = "blockchain_market_order_history";
	
	public static CommandJson test(String quoteAssetSymbol, String baseAssetSymbol, int skipCount, int limit, String owner) {
		return doTest(COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, skipCount, limit, owner });
	}
	
	public static List<BlockchainMarketOrderHistory.Result> run(String quoteAssetSymbol, String baseAssetSymbol, int skipCount, int limit, String owner) throws BTSSystemException {
		return run(0, quoteAssetSymbol, baseAssetSymbol, skipCount, limit, owner);
	}
	public static List<BlockchainMarketOrderHistory.Result> run(int id, String quoteAssetSymbol, String baseAssetSymbol, int skipCount, int limit, String owner) throws BTSSystemException {
		BlockchainMarketOrderHistory i = (BlockchainMarketOrderHistory) new BlockchainMarketOrderHistory().doRun(
				id, COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, skipCount, limit, owner });
		i.checkSystemException();
		return i.getResult();
	}
	
